import Login from './Login.js'
import Register from './Register.js'
import Navbar from './Navbar.js'

function App() {
  let Component
  switch (window.location.pathname) {
    case "/":
      Component = App
      break
    case "/login":
      Component = Login
      break
    case "/register":
      Component = Register
      break
  }
  return (
    <div>
      <Navbar/>
    </div>

  );
}

export default App;
